import React from 'react';
import { Header, Icon, Player } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Header as='h2' icon textAlign='center'>
                {/* <video
                    autoPlay
                    loop
                    muted
                    style={{
                        position: "absolute",
                        width: "100%",
                        objectFit: "cover",
                        transform: "translate(-50%,-10%)"
                    }}
                >
                    <source src={Vikings} type="video/mp4" />
                </video> */}
                <Player playsInline fluid={false} width={100} height={50}>
                    <source src="Vikings" />
                    <ControlBar>
                        <PlaybackRateMenuButton rates={[2, 1.5, 1]} order={7.1} />
                        <VolumeMenuButton disabled />
                    </ControlBar>
                </Player>
            </Header>
            <div>dsfsdfsdfsd</div>
        </React.Fragment>
    )
}

export default HeaderPart;
